import { Link } from "react-router-dom";

const Dashboard = () => {
    return (
        <>  
            <h1>Home</h1>
            <nav>
                <ul>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/addReservation">Add Reservation</Link>
                    </li>
                    <li>
                        <Link to="/editReservation">Edit Reservation</Link>
                    </li>
                </ul>
            </nav>
        </>
    )
};

export default Dashboard;
